(20, 'Sta. Cruz fire resulted to one fatality', 'The fatality, identified as Karen Tan-Caparas, was found inside the comfort room of their unit located at the ninth floor of Blue Diamond Tower.\r\n\r\nInitial report disclosed that Caparas was with her mother, Arsenia Tan, and relatives namely Wilmel and Erica Caparas before the incident happened.\r\n\r\nShe was supposed to go to work as a casino dealer at 1 p.m.\r\n\r\nMeanwhile, the victim’s live-in partner Albert, a fire volunteer, was out for another job.\r\n\r\nAt 9:52 a.m. on Jan. 16, the blaze sparked at Caparas’s unit.\r\n\r\nIt only reached second alarm and was totally extinguished at 10:50 a.m.\r\n\r\nCaparas was trapped inside their bathroom; while, her family members managed to escape the inferno.\r\n\r\nAt least P100, 000 worth of property were damaged according to the Bureau of Fire Protection (BFP)-Manila.\r\n\r\nThe cause of fire is yet to be determined.\r\n\r\nFurther investigation is underway.\r\n\r\n“We will verify if the building is in compliance with Republic Act 9514 or the fire code [since] I did not see any sprinkler though there was a fire exit on the side,” said Manila arson chief investigator Senior Insp. Reden Alumno.\r\n\r\nJust last Tuesday, three family members died from a fire that gutted a two-storey house in Sampaloc, Manila.', NULL, '2019-02-04 00:56:52', 0),
(22, 'Build Malay fire station now, town execs urge BFP', 'AKLAN, Philippines – The Sangguniang Bayan (SB) of Malay wants the Bureau of Fire Protection (BFP) to construct the proposed fire station in mainland Malay in the next 3 years.\nThe municipal government is donating a vacant lot of around 400 square meters in Barangay Caticlan.\nCouncilor Jupiter Aelred Gallenero said that \"3 years is enough for BFP to process the donation and construction of the fire station building.\"\nA fire station in the first-class municipality will enable firefighters and volunteers to respond immediately to fire in urban areas in mainland Malay.\nGallenero said the BFP officials appealed to the municipal government during a committee hearing last week for longer time to process a new deed of donation for a parcel of land and fire station construction.\nA year ago, the legislative council endorsed a resolution where the local government unit would only provide the lot as its counterpart, while the national government, through the BFP, would allocate funds, personnel, and fire trucks.\nSB member Floribar Bautista also urged the BFP to expedite the construction of building located in the commercial area.\n\"We will develop the land for other purposes if there is no construction of a fire building in the next two or three years,\" he added.\nCurrently, BFP has a fire substation in Boracay Island in Barangay Manoc-Manoc under the leadership of Municipal Fire Marshall Senior Fire Inspector Lorna Parcellano.\nIn Aklan province, the towns of Kalibo, New Washington, Balete, Altavas, Libacao, Numancia, Tangalan, Ibajay, and Buruanga have fire stations.\nThe fire stations in Malinao, Makato, and Madalag are undergoing construction. The 4 towns without fire stations are Lezo, Batan, Nabas, and Banga.\n', '[\"Build Malay fire station now, town execs urge BFP.jpg\"]', '2019-02-27 16:36:06', 4),
(23, 'BFP holds Fire Square Road show in Maasin City', 'MAASIN CITY, Jan. 18 (PIA) -- More than 300 elementary pupils in Maasin City participated on Sunday, Jan. 13, in the Fire Square activities conducted by the Bureau of Fire Protection (BFP).\nAccording to BFP-8 Regional Director, F/SSupt. Rico Neil Kwan Tiu, the roadshow is a caravan for public safety awareness and resiliency among the pupils.\n“It is an interactive activity where lectures and actual basic public safety preparedness are combined,” Tiu, who led the firefighters, said.\nEight stages of concepts were introduced to the Grades IV-VI participants  such as bandaging, cardiopulmonary resuscitation (CPR), knot tying, rappelling, fire safety tips, how to use a fire extinguisher, fire prevention and disaster preparedness.\nThe roadshow banners the theme, “Safety starts with wareness, Awareness starts with us.”\nThe BFP-Maasin City Fire Station recommends basic fire safety and fire drills down to the barangay level, a very important community undertaking for everyone\'s safety.\nThe elementary pupils, as well as their parents, guardians and the viewing public had the privilege to experience and witness the Fire Square Road Show activities such as the real-life scenarios and how to prepare and respond quickly and safely during emergency situations.\nMaasin City Mayor Nacional Mercado, who delivered his inspirational message, also witnessed and participated the one-day activity together with the BFP Provincial Director CInsp. Dorotheo Claro Mocorro and the strong firefighters from the local Fire Station and from the regional office. (LDL/RGC/PIA8-Southern Leyte)\n', '[\"BFP holds Fire Square Road show in Maasin City.jpg\"]', '2019-02-27 16:36:44', 4),
(24, 'BFP: Awareness key to prevent fire', 'CEBU, Philippines — The Bureau of Fire Protection (BFP)-7 is eyeing to continue the decreasing fire incidence in the region through massive information drive and community involvement.\nFire Senior Superintendent Samuel Tadeo, BFP-7 regional director, revealed on Thursday that fire incidents in Central Visayas had decreased by 26.13 percent from 842 cases in 2016 to 622 cases in 2017\n“Maganda ang resulta ng pagtutulongan natin no’ng 2017 sapagkat napababa natin ang mga sunog by 26 percent. We are hoping that we could further decrease it this year despite the challenges that we met at the start of 2018,” he said in a speech during a brief kickoff program yesterday.\nIn January alone this year, there were already 76 cases, including the days-long conflagration that hit Metro Ayala department store in Cebu City.\nThe BFP-7 formally opened yesterday the Fire Prevention Month with the theme “Ligtas na Pilipinas ang ating Hangad. Pag-iingat sa sunog ay sa sarili ipatupad” with a series of activities.\nAmong the activities yesterday were the advocacy walk, simulation exercise, and motorcade to raise awareness among people in promoting a fire-free region.\n“This year’s theme actually reflects the ultimate goal of the BFP which is to enable each and every member of the community to become fire-safety conscious individuals especially in their respective homes,” said Tadeo.\nHe said most fire events can be attributed to negligence when parents fail to look after their children playing electric wires or adults leave alone plugged electric fan or iron.\nOther preventive measures that the BFP-7 is doing include linking with other entities or offices like the city government’s Cebu City Disaster Risk Reduction Management Office\n', '[\"BFP Awareness key to prevent fire.jpg\"]', '2019-02-27 16:37:29', 4),
(25, ' BFP-6 needs 100 fire officers', 'SAN JOSE, Antique, May 29 (PIA) -- The Bureau of Fire Protection (BFP)-6 is in need of 100 recruits to fill in the positions for Fire Officer I (FO1).\nSenior Superintendent Alan Aladano, regional director of BFP-6, said that the national headquarters has allocated 100 positions for their quota in Western Visayas for Fire Officer 1 this year.\n“I’d like to take this opportunity to invite qualified applicants to apply to their nearest fire station,” he said.\nTo qualify for FO1, applicants must have civil service eligibility – professional level or Professional Regulation Commission (PRC) license pursuant to Republic Act 1080; must not be more than 30 years old; preferably between 22 to 29 years old; and must be at least 5’4” in height for males and 5’2” for females.\nCurrently, BFP-6 has 1,658 personnel. According to Aladano, the salary is almost the same with that of the Philippines National Police (PNP) and the Bureau of Jail Management and Penology (BJMP).\nHe was in San Jose town on May 23 for the BFP-6 command conference.\nMunicipal fire stations in Antique reported their accomplishments from 2016 up to the first quarter of 2018 during the conference. (CBA/PIA-Antique)\n', '[\"BFP-6 needs 100 fire officers.jpg\"]', '2019-02-27 16:37:58', 4),
(26, 'Seven BFP officers promoted to next ranks', 'Department of Interior and Local Government (DILG) Officer-in-Charge Eduardo Ano today announced the promotion of seven officers of the Bureau of Fire Protection (BFP) to the rank of Senior Superintendent.\nAno identified the newly-promoted fire officers as Sr. Supt. Gilbert D. Dolot, Sr. Supt. Roderick P. Aguto, Sr. Supt. Renato B. Marcial, Sr. Supt. Jonas R. Silvano, Sr. Supt. Joe Fernando L. Bangyod, Sr. Supt. Romeo M. Maltezo, Supt. Sydney C. Besana.\nAno encouraged the newly promoted officers to be a watchdog in the fight against graft and corruption on the bureau in support to the Bantay Kaagapay at Subaybayan project which will be launched soon.\nThe seven officers took their oath before Ano in a simple ceremony witnessed by Undersecretary Nestor Quinsay, Jr. and families of the officers at the DILG-NAPOLCOM Center Building in Quezon City.\nAguto, Dolot and Silvano belong to Philippine National Police Academy (PNPA) Class 1996. Besana is a member of PNPA Class 1992, while Bangyod is from Class 1997. On the other hand, Marcial and Maltezo rose from the ranks.\nAguto is presently the Regional Director of BFP Region IV-B (MIMAROPA), while Dolot, Marcial, and Maltezo are presently assigned as Chief of Directorates at the BFP-National Headquarters. \nSilvano is the District Fire Marshal of Manila, while Bangyod is presently the Pangasinan Provincial Fire Chief. On the other hand, Besana is assigned at the Davao Fire District.\nThe officers were promoted upon the recommendation of BFP Director Leonard Banago and approved by the Office of the Secretary last April 5, 2018.\n', '[\"Seven BFP officers promoted to next ranks.jpg\"]', '2019-02-27 16:38:23', 4),
(27, 'Fire out at Manila Pavilion after 25 hours', 'MANILA, Philippines – After 25 hours of facing flames and smoke at the Waterfront Manila Pavilion Hotel & Casino, firefighters have declared \"fire out,\" signaling the end of an inferno that killed at least 5 and injured 24.\nFlames broke out in the hotel at around 9:30 am on Sunday, March 18, generating clouds of thick smoke at the Ermita District in Manila.\nThe fire was only put out the next day at 10:56 am, Metropolitan Manila Development Authority (MMDA) Acting General Manager Jojo Garcia told Rappler in a text message.\nThe death toll includes 4 Philippine Amusement and Gaming Corporation (Pagcor) employees and another unidentified corpse recovered near the hotel\'s CCTV room.\nHow the fire started: The blaze erupted from the ground floor and spread to the rest of the 22-story hotel, authorities announced in a Sunday evening press briefing.\nFiremen arrived at 9:53 am on Sunday, immediately raising the 3rd alarm. By 11:32 am, the fire alarm peaked at Task Force Bravo, or 3 levels higher than the initial declaration. The higher the alarm, the more fire fighters are allowed to be called to respond.\nThe fire was declared under control at 8 am on Monday, before authorities fully put out the flames around 3 hours later.\nWhy it took so long: Bureau of Fire Protection (BFP) officials said on Sunday that the smoke inside the hotel was too thick, preventing firefighters from immediately entering.\nIt also did not help, fire officials said, that the hotel was heavily lined with carpets and curtains which produce heavy smoke when torched.\n\n', '[\"Fire out at Manila Pavilion after 25 hours.jpg\"]', '2019-02-27 16:38:45', 4),
(28, 'BFP reports significant decline in fire cases in welcoming the New Year', 'MANILA, Philippines – The Bureau of Fire Protection (BFP) has recorded only 7 fire incidents during the year-end revelry on Monday (December 31) midnight to 8:00 a.m. of Tuesday (January 1).\nAccording to BFP Spokesperson FSupt. Joanne Vallejo, six incidents were recorded in Metro Manila and one in Ilocos.\nAll cases were caused by faulty electrical wiring system and  none were firecracker related.\nAccording to BFP, the figures this year is lower by 82.35% as compared to the record in 2018 with 34 fire incidents.\nThe estimated amount of damage from all seven fire incidents were recorded at more than P70,000, a significant decline from P7.5 million-worth of damage in 2017.\nFor the entire year, however, the agency recorded a total of 16,215 fire cases which was higher than last year with only 14,117.\nBut despite the increase in number of fire incidents this year, the overall amount of damage was lower with only P4.3 billion pesos as compared to last year which hit P21 billion pesos.\nAccording to the agency, the only firecracker-related fire involved a tricycle in Bulacan loaded with firecracker.\n“Sa palagay ko mam it is not about the rain or because of the rain kasi po ang leading po na cause ng sunog natin ay electrical,” Vallejo added.\nMeanwhile, rains did not minimize the level of pollution that firecracker fumes caused the air.\nAccording to the Environment Management Bureau (EMB) Assistant Director Vizminda Osorio, the highest level of pollution was recorded in between 3:00 p.m. and 7:00 p.m. in the morning on January 1.\n', '[\"BFP reports significant decline in fire cases in welcoming the New Year.jpg\"]', '2019-02-27 16:39:10', 4),
(29, 'Makati BFP leads Fire safety seminar', '\nThe Makati Bureau of Fire Protection (BFP) conducted a Fire Safety and Basic Rescue Seminar on Friday morning, September 21. \nIt was participated by members of the Fire Brigade Team of Prudential Customs Brokerage Services, Inc. \nThe participants were taught how to safely put out fires using a water hose and fire extinguisher as well as how to assist an injured person during emergencies.\n', '[\"Makati BFP leads Fire safety seminar.jpg\"]', '2019-02-27 16:39:39', 4),
(30, 'BLOG: Five Common Causes of Fire Incidents and How to Prevent Them', 'The month of March marks the beginning of summertime in the Philippines. However, in connection with the warm and dry climate during the season, authorities are also expecting a higher number of fire incidents in the country, particularly in residential areas. Hence, every year, the Philippines is observing March as the Fire Prevention Month by the virtue of Presidential Proclamation No. 115-A which was signed by President Ferdinand Marcos in 1966.\nEach year, the Bureau of Fire Protection (BFP) records several fire incidents in the country. According to the four-year statistics released by BFP, the country registered a total of 40,696 fire incidents from 2010 to 2013; 16,783 of these or equivalent to 41.2% happened in residential areas. Undoubtedly, these fire incidents claimed lives and caused substantial damages to property. During the same four-year period, fire casualties reached a total of 3,864 individuals and more than P17-billion (P17,137,656,893) worth of property damages.\nSadly, in spite of the situation, the country is lacking in terms of fire fighting resources and force. In 2012, the country had only 16,252 fire fighters amid the total population of 95,771,064 or equivalent to a ratio of 1:5,893. Hence, it is indeed a responsibility of each of us to implement measures that foster safety and fire prevention, whether you are living in a condominium unit or a house and lot setup. In this article, we have identified the five common causes of fire in residential areas and some ways on how to prevent them.\n\n', '[\"BLOG Five Common Causes of Fire Incidents and How to Prevent Them.jpg\"]', '2019-02-27 16:39:57', 4),
(31, 'Bureau of Fire Protection Says Number Of Fire Incidents In The National Capital Region Has Increased In 2018', '\nFIRE INCIDENTS – The Bureau of Fire Protection – National Capital Region (BFP-NCR) division says that the number of fire incidents have increased this year.\nBFP-NCR official Colonel Rizalde Castro said that the incidents were not mainly caused by firecrackers, but were caused by cigarettes and electricity.\nCastro said that according to the data, the number of incidents this year is 4,698 compared to last year, which is 4,646. He further noted that electricity, in nature, is the top one cause of fire incidents, with cigarettes as the top two.\nAccording to GMA News, Castro further said that President Duterte’s Executive Order (EO) No. 28 has been a great help as there are no reported incidents caused by firecrackers, still implying that the data showed electricity-related and cigarette-related incidents.\n\n', '[\"Bureau of Fire Protection Says Number Of Fire Incidents In The National Capital Region Has Increased In 2018.jpg\"]', '2019-02-27 16:40:24', 4),
(32, 'DataReport', 'This is the results of clustering of fire incidents of Manila', '[\"Clustering result.docx\"]', '2019-04-18 13:13:33', 8);
